function App() {
  return (
    <div className="App">
      <Router>
            <Header/>

              <Route path="/" exact component={ProductListing}/>
            <Route path="/product/:productId" exact component={ProductDetails}/>
            <Route>404 Page Not Found !
              </Route>


      </Router>

    </div>
  );
}

export default App;
